import PropTypes from 'prop-types';

Test.propTypes = {
    name: PropTypes.string,
  };
  
  Test.defaultProps = {
    name: "nasmdfnsa",
  };

const Test = props => {
    const { name } = props;
    return (
        <div className="taskItem">
        <label> Title {name}</label>
        <label> Creator</label>
        <label> Status</label>
        <p>
          Desscription: <br />
        </p>
      </div>
    );
};

Test.propTypes = {
    
};

export default Test;
